// about 100x times faster
func BenchmarkSolve(b *testing.B) {
	b.StopTimer()
	for i := 0; i < b.N; i++ {
		g := make([][]byte, len(grid))
		for i, v := range grid {
			g[i] = make([]byte, len(v))
			copy(g[i], v)
		}
		b.StartTimer()
		solve(g)
		b.StopTimer()
	}
}

